import React from "react";
import { Route, Navigate } from "react-router-dom";

function PrivateRoute({ isAuthenticated, children, ...rest }) {
  return (
    <Route
      {...rest}
      render={() => (isAuthenticated ? children : <Navigate to="/login" />)}
    />
  );
}
